(function($){
    $.fn.customSB = function() {
	   var a = 0;
	   var obj = this;
	   this.each(function(){
		   var selectBox = $(this).html();
		   var list = selectBox.replace(/option/g,'li');
		   var html = '<ul>'+list+'</ul>';
		   $(this).before('<div class="listBox"></div>');
		   $('.listBox').eq(a).append(html);
		   $('.listBox ul li').each(function(){
			   $(this).removeAttr('value');
		   });
		   a++;
		   $(this).css('display','none');
	   });
	   $('.listBox ul li').click(function(){
		   $('.listBox ul li').removeClass('selected');
		   $(this).addClass('selected');
		   var liPos = $(this).index();
		   var sVal = $(this).closest('.customSB').find('select option').eq(liPos).val();
		   $(this).closest('.customSB').find(obj).val(sVal);
	   });
	   return this;
    }
 }(jQuery));

//JavaScript Document
function getValidate(ctrl,typ)
{
	var filter;
	var err;
	var val=$.trim($("#"+ctrl).val());
	var res=true;
	/*val=val.replace(/<.[^<>]*?>/g,'').replace(/&nbsp;|&#160/gi,'').replace(/&gt;/gi,'').replace(/&lt;/gi,'').replace(/&quot;/gi,'').split('$').join(' ');*/
        //val=val.replace(/</g,'&lt;').replace(/>/g,'&gt;').replace(/&nbsp;|&#160/gi,'').replace(/&quot;/gi,'').split('$').join(' ');
	$("#"+ctrl).val(val);
	switch(typ)
	{
		case "nick":
			filter=/^[a-zA-Z0-9-_]+[a-zA-Z0-9-_]?$/; 
			err="Only text (a-z), numbers(0-9) and some special characters (- and _) are allowed.";
			break;
		case "pwd":
			//filter=/^[a-zA-Z0-9-_\.\!\~`#%*\-+,\/\)\(\[\]\{\}]+$/; 
			filter=/^[a-zA-Z0-9`!\@#\$%\^\&*\(\)_\-\+=\[\]\{\}\|\\:\?\/;\"\'<\,>\.]+$/;
			err="Only text (a-z), numbers(0-9) and some special characters are allowed.";
			break;
		case "code": 
			filter=/^[a-zA-Z0-9-_\.\/]+[a-zA-Z0-9-_\.\/]?$/; 
			err="Only text (a-z), numbers(0-9) and some special characters (-, ., _, /) are allowed.";
			break;
		case "name": 
			filter=/^[a-zA-Z'\.][a-zA-Z-' \.]+[a-zA-Z'\.]?$/; 
			err="Only text and spaces are allowed";
			break;
		case "email": 
			//filter=/^([A-Za-z0-9_\-\.\'])+\@([A-Za-z0-9_\-\.])+\.([A-Za-z]{2,6})$/;
			filter=/^([\w-]+(?:\.[\w-]+)*)@((?:[\w-]+\.)*\w[\w-]{0,66})\.([a-z]{2,6}(?:\.[a-z]{2})?)$/i; 
			err="Only email address is allowed.";
			break;
		case "int":
			filter=/^[\-\+]?\d+$/; 
			err="Only positive,negetive numbers are allowed.";
			break;
		case "num": 
			filter=/^[\-\+]?(([0-9]+)([\.,]([0-9]+))?|([\.,]([0-9]+))?)$/; 
			err="Only numbers with positive, negetive (+-), comma and dot is allowed";
			break;
		case "amt": 
			filter=/^[0-9]+$/;
			err="Only numbers are allowed.";
			break;
		case "txt": 
			filter=/^[a-zA-Z\ \']+$/; 
			err="Only a-z and space are allowed.";
			break;
		case "txtnum": 
			filter=/^[0-9a-zA-Z \.]+$/; 
			err="Only 0-9 and a-z space and dot (.) is allowed.";
			break;
		case "txtspl":
			filter=/^[0-9a-zA-Z\' \.\!\~`#%*\-+,\/\)\(\[\]\{\}]+$/;
			err="Only 0-9 and a-z space and some special characters (., !, ~, `, ', /, (), {}, [], %, *, - and +) are allowed.";
			break;
		case "url": 
			filter=/^(https?|ftp):\/\/(((([a-z]|\d|-|\.|_|~|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])|(%[\da-f]{2})|[!\$&'\(\)\*\+,;=]|:)*@)?(((\d|[1-9]\d|1\d\d|2[0-4]\d|25[0-5])\.(\d|[1-9]\d|1\d\d|2[0-4]\d|25[0-5])\.(\d|[1-9]\d|1\d\d|2[0-4]\d|25[0-5])\.(\d|[1-9]\d|1\d\d|2[0-4]\d|25[0-5]))|((([a-z]|\d|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])|(([a-z]|\d|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])([a-z]|\d|-|\.|_|~|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])*([a-z]|\d|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])))\.)+(([a-z]|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])|(([a-z]|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])([a-z]|\d|-|\.|_|~|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])*([a-z]|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])))\.?)(:\d*)?)(\/((([a-z]|\d|-|\.|_|~|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])|(%[\da-f]{2})|[!\$&'\(\)\*\+,;=]|:|@)+(\/(([a-z]|\d|-|\.|_|~|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])|(%[\da-f]{2})|[!\$&'\(\)\*\+,;=]|:|@)*)*)?)?(\?((([a-z]|\d|-|\.|_|~|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])|(%[\da-f]{2})|[!\$&'\(\)\*\+,;=]|:|@)|[\uE000-\uF8FF]|\/|\?)*)?(\#((([a-z]|\d|-|\.|_|~|[\u00A0-\uD7FF\uF900-\uFDCF\uFDF0-\uFFEF])|(%[\da-f]{2})|[!\$&'\(\)\*\+,;=]|:|@)|\/|\?)*)?$/; 
			err = "Only url is allowed.";
			break;
		case "phone": 
			//filter=/^([\+][0-9]{1,3}[ \.\-])?([\(]{1}[0-9]{2,6}[\)])?([0-9 \.\-\/]{3,20})((x|ext|extension)[ ]?[0-9]{1,4})?$/; 
			filter=/^([\+][0-9]{1,3}[ \.\-])?([\(]{1}[0-9]{2,6}[\)])?([0-9 \.\-\/,]{1,50})((x|ext|extn)[ ]?[0-9]{1,4})?$/;
			err = "Only phone numbers with x,ext,extn is allowed.";
			break;
		case "mobile": 
			//filter=/^([\+][0-9]{1,3}[ \.\-])?([\(]{1}[0-9]{2,6}[\)])?([0-9 \.\-\/]{3,20})((x|ext|extension)[ ]?[0-9]{1,4})?$/; 
			//filter=/^([\+]{0,1}[0-9]{1,3}[\-]{0,1})?([\(]{0,1}[0-9]{10}[\)]{0,1})?$/;
			filter=/^([\+]{0,1}[0-9]{1,3}[\-]{0,1})?([\(]{0,1}[0-9]{10}[\)]{0,1})?$/;
			err = "Only valid mobile munber is allowed.";
			break;
		case "tdate": 
			filter=/^(January|February|March|April|May|June|July|August|September|October|November|December)[ ][0-9]{1,2}[ ][0-9]{4}$/; /*\d{4}[\/\-](0?[1-9]|1[012])[\/\-](0?[1-9]|[12][0-9]|3[01])*/
			err="Only valid date format (Month dd yyyy) is allowed.";
			break;
		case "idate": 
			filter=/^\d{4}[\/\-](0?[1-9]|1[012])[\/\-](0?[1-9]|[12][0-9]|3[01])$/; 
			err="Only valid date is allowed.";
			break;
		case "tdatetime": 
			filter=/^(January|February|March|April|May|June|July|August|September|October|November|December)[ ][0-9]{1,2}[ ][0-9]{4}[ ][0-9]{1,2}:[0-9]{1,2}$/; /*\d{4}[\/\-](0?[1-9]|1[012])[\/\-](0?[1-9]|[12][0-9]|3[01])*/
			err="Only valid date format (Month dd yyyy) with time (hh:mm) is allowed.";
			break;
		case "idatetime": 
			filter=/^\d{4}[\/\-](0?[1-9]|1[012])[\/\-](0?[1-9]|[12][0-9]|3[01])[ ][0-9]{1,2}:[0-9]{1,2}$/; 
			err="Only valid date is allowed.";
			break;
		case "req":
		case "addr":
		case "ltxt":
			filter=""; 
			break;
		default: 
			//$.error("jQueryValidator rule not found"+rules[i]);
	}
	$("#"+ctrl).removeClass('errX');
	if($.trim(val)=="")
	{
		var emsg="<div class='erd'>Field should not be empty.</div>";
		$("#"+ctrl).addClass('errX');
		$(emsg).insertAfter($("#"+ctrl));
		return false;
	}
	else if(typ=="req" || typ=="addr" || typ=="ltxt")
	{
                if($.trim(val)=="")
		{
			var emsg="<div class='erd'>Field should not be empty.</div>";
			$(emsg).insertAfter($("#"+ctrl));
			$("#"+ctrl).addClass('errX');
			return false;
		}
	}
	else
	{
		$("#"+ctrl).removeClass('errX');
		res=filter.test(val);
		if(res==false)
		{
			var emsg="<div class='erd'>"+err+"</div>";
			$(emsg).insertAfter($("#"+ctrl));
			$("#"+ctrl).addClass('errX');
			return res;
		}
		else if(typ=="pwd")
		{
			var strength = 1;
			var arr = [/{6\,}/, /[a-z]+/, /[0-9]+/, /[A-Z]+/];
			$.each(arr, function(i, regexp) {
	  			if(val.match(regexp))
     				strength++;
			});
			if(strength<2 || val.length<6 || val.length>20)
			{
				var emsg="<div class='erd'>Please enter valid password.</div>";
				$(emsg).insertAfter($("#"+ctrl));
				$("#"+ctrl).addClass('errX');
				return false;
			}		
		}
	}
}

function cleanup(ctrl)
{
	var val=$.trim($(ctrl).val());
	//val=val.replace(/</g,'&lt;').replace(/>/g,'&gt;').replace(/&nbsp;|&#160/gi,'').replace(/&quot;/gi,'').replace(/'/gi,'&#039').split('$').join(' ');
	//alert(val);
	//$(ctrl).val(val);
	var last = val.charAt(val.length-1);
	if(last==",")
		val=val.replace(/(\s+)?.$/, '');
	$(ctrl).val(val);
}

